import React, { useEffect } from 'react';
import { useSelector } from 'react-redux';
import { getUser } from '../redux/users/selectors';

const ThankYou = () => {
    const selector = useSelector(state => state);
    const user = JSON.parse(localStorage.getItem('LOGIN_USER_KEY'));
    useEffect(() => {
        console.log(user);
    }, []);
    return (
        <div>
            <div class="box">
                <p>Thank you for your ordering</p>
            </div>

            <div class="message">
                <p>
                    Thank you for your ordering <span class="color">{user.username}</span>. We received your request.{' '}
                    <br />
                    <br />
                    Our staff will be contacting with you to tell next steps.
                </p>
            </div>

            <div class="backhome">
                <a href="/">
                    <button>Back to Home</button>
                </a>
            </div>
        </div>
    );
};

export default ThankYou;
